import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Check if cart has items by looking at the cart count
    const cartCount = await page.$eval('.cart', el => {
      const text = el.textContent;
      const match = text.match(/(\d+)/);
      return match ? parseInt(match[0]) : 0;
    });

    if (cartCount === 0) {
      throw new Error('Cart is empty - no items to remove');
    }

    // Open cart modal
    await page.click('.cart');
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_opened.png'));

    // Find and click the remove button for the first item
    await page.waitForSelector('.remove-item', { timeout: 5000 });
    await page.click('.remove-item');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_item_removed.png'));

    // Verify removal by checking updated cart count
    const newCartCount = await page.$eval('.cart', el => {
      const text = el.textContent;
      const match = text.match(/(\d+)/);
      return match ? parseInt(match[0]) : 0;
    });

    return {
      success: true,
      action: "Removed item from cart successfully",
      extractedData: {
        initialCartCount: cartCount,
        finalCartCount: newCartCount,
        itemsRemoved: cartCount - newCartCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
